import React, { Component } from "react";
import { Container } from "@material-ui/core";
import storePic from "../../assets/img/veg.jpg";
import { Typography } from "@material-ui/core";
import { Autorenew } from "@material-ui/icons";

const styles = {
  page: {
    backgroundImage: `url(${storePic})`,
    backgroundPosition: "center",
    backgroundSize: "115%",
    backgroundRepeat: "no-repeat",
    marginLeft: 'auto',
    marginRight: 'auto'
  },
  img : {
      position: 'fixed',
      top: 0,
      left: 0,
      minWidth: '100%',
      minHeight: '100%'
  }
//   welcome: {
//     marginLeft: "auto",
//     marginRight: "auto",
//   },
};

export default class Home extends Component {
  render() {
    return (
      <div id="home" style={styles.page}>
       <img src={storePic} alt='storePic' style={{}}/>
      </div>
    );
  }
}
